import styled from 'styled-components';

const Container = styled.div`
    width: 400px;
    margin: 0 auto;
    text-align: center;
`;

const Table = styled.div`
    display: grid;
    width: 300px;
    margin: 20px;
`;

export function Score ({ firstName, score: {math, english, history} }) {
    return (
        <div>
            <h2>{firstName}'s Scores</h2>
            <Table>
                <tbody>
                    <tr>
                        <Th>Subject</Th>
                        <Th>Score</Th>
                    </tr>
                        <tr>
                            <Td>"Math"</Td>
                            <Td>{math}</Td>
                        </tr>
                        <tr>
                            <Td>"English"</Td>
                            <Td>{english}</Td>
                        </tr>
                        <tr>
                            <Td>"History"</Td>
                            <Td>{history}</Td>
                        </tr>
                </tbody>
            </Table>
        </div>
    );
};
